import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import './navigation.css';
import Navigation1 from './Navigation1'

const mql = window.matchMedia(`(min-width: 800px)`);

class Navigation extends Component {
    render() {
        return (
            <div id="wrapper">
                <div className="warp">
                    <Navigation1 />
                </div>
                <div id="sidebar-wrapper">
                    <ul id="sidebar-nav">
                        <li className="hell"><a href="#">QR App</a></li>
                        <li><img id="propic" src="https://i.stack.imgur.com/l60Hf.png" height="40px" width="40px" /></li>
                        <li><cite>You are logged in</cite></li>
                    </ul>
                    <ul id="sidebar-nav1" className="hello1">
                        <li className="hell">
                            <div className='hello123'>
                            <select className="custom-select">
                                <option value='Select the Plant' selected disabled>Select the Plant</option>
                                <option value='Kothagadi'>Kothagadi</option>
                                <option value='Orai'>Orai</option>
                                <option value='Parigi'>Parigi</option>
                                <option value='Peerampalle'>Peerampalle</option>
                                <option value='Rohini'>Rohini</option>
                            </select>
                            </div>
                        </li>
                        <li><a href='http://localhost:5000/plantstats'>PlantStats</a></li>
                        <li><a href="http://localhost:5000/zonestats">Zone Stats</a></li>
                        <li><a href="http://localhost:5000/rowstats">Row Stats</a></li>
                    </ul>
                    <ul id="sidebar-nav" className="hello2">
                        <li className="hell"><a href="#">Logged In as</a></li>
                        <li>Surya Sai</li>
                        <li><a href="http://localhost:5000/signin">Log Out</a></li>
                    </ul>
                </div>
            </div>
        );
    }
}

export default Navigation;


